import request from '@/utils/request'; //查询条码

export function queryRecords(barCode, query) {
  return request({
    url: "/mes/plan/work/barcode/".concat(barCode),
    method: 'get',
    params: query
  });
}
export function queryWorkOrder(query) {
  return request({
    url: '/mes/plan/work',
    method: 'get',
    params: query
  });
}
export function loadMaterial(data) {
  return request({
    url: '/mes/plan/work/loadMaterial',
    method: 'post',
    data: data
  });
}
